function remove_edges(s,d)
{
    var key = "";
    for (let i = 0; i < d.length; i++) {
        key += 'h'+d[i];
    }
    var val = edges_placed[key];
    var color = color_placed[key];
    val = val.split(";");
    for(let i = 0;i<val.length-1;++i)
    {
        s.graph.dropEdge(val[i]); 
    }
    s.refresh();
    delete edges_placed[key];
    delete color_placed[key];
    appliedColors.delete(color);
}

function clearEdges(s)
{
    for(var key in edges_placed) 
    {
        var val = edges_placed[key];
        var color = color_placed[key];
        val = val.split(";");
        for(let i = 0;i<val.length-1;++i)
        {
            s.graph.dropEdge(val[i]); 
        }
        s.refresh();
        delete edges_placed[key];
        delete color_placed[key];
        appliedColors.delete(color);    
    }
    var table = $('#running').DataTable();
    table.$('tr.selected').removeClass('selected');
}